def Opcion1_IP():
    
    LimpiarPantalla()
    Logo_Opcion1()
    
    IP1=input("Inserte la IP que quiere analizar ---> ")
    Data1=ConsultaDeIPAbuseDb(IP1)
    while True:
        if(Validar_IP(Data1)=="Publica"):
            Data2=ConsultaDeIPQualityScore(IP1)
            Data3=ConsultaDeIPVirusTotal(IP1)
            Data4=ConsultaDeAbstractApi(IP1)
        
            Conjunto_Analisis_De_IP(IP1,Data1,Data2,Data3,Data4)
            break
            
        elif(Validar_IP(Data1)=="Privada"):
            print("Privada")
            break
        else:
            print("No se pudo validar la dirección ip insertada, revise la dirección ingresada y vuelva a intentar")
            break

